var MatchMedia = function( media_query ) {
    var matchMedia = window.matchMedia,
        is_supported = (typeof matchMedia === "function");
    if (is_supported && media_query) {
        return matchMedia(media_query).matches
    } else {
        return false;
    }
}

function scrollbarWidth() {
	var a = document.createElement("div");
	a.style.visibility = "hidden", a.style.width = "100px", a.style.msOverflowStyle = "scrollbar", document.body.appendChild(a);
	var b = a.offsetWidth;
	a.style.overflow = "scroll";
	var c = document.createElement("div");
	c.style.width = "100%", a.appendChild(c);
	var d = c.offsetWidth;
	return a.parentNode.removeChild(a), b - d
}

function menus(){
	if($("#sidebar-cats").length){
		$("#sidebar-cats").metisMenu({
			preventDefault: true,
			toggle: false,
			triggerElement: '.clicker-arrow',
		});
    }
    if($("#metismenu-mobile").length){
		$("#metismenu-mobile").metisMenu({
			preventDefault: false,
			triggerElement: '.clicker-arrow',
		});
	}
    if($("#metis-mobile").length){
		$("#metis-mobile").metisMenu({
			preventDefault: false,
			triggerElement: '.clicker-arrow',
		});
	}
}

function openMobileMenu(){
	$(".mobile-header").on('click', '.open-menu a', function(e) {
		e.preventDefault();
		var $popup = $('.hidden-mobile-menu'),
			$btn = $(this),
			$btnClose = $popup.find('.close'),
			$overlay = $('.popup-overlay'),
			$sbw = scrollbarWidth();

		if ($btn.length && $popup.length) {
			var self = $(this);
			if (!self.hasClass('active')) {
				$overlay.addClass('active');
				$('body').css({
				   'overflow' : 'hidden',
				   'width' : 'calc(100% - ' + $sbw + 'px)',
				});
				setTimeout(function(){
					$overlay.addClass('visible');
					$popup.addClass('active');
				}, 0);
			}
			$btnClose.on('click', function(){
				if ($popup.hasClass('active')) {
					$popup.removeClass('active');
					$overlay.removeClass('visible');
					$('body').css({
						'overflow' : 'visible',
						'overflow-x' : 'hidden',
						'width' : 'inherit',
					});
					setTimeout(function(){
						$overlay.removeClass('active');
					}, 200);
				}
			});
			$(document).on('click', function(e){
				$target = $(e.target);
				isPopup = !!$target.closest($popup).length;
				if (!isPopup && $popup.hasClass('active')) {
					$popup.removeClass('active');
					$overlay.removeClass('visible');
					$('body').css({
					   'overflow' : 'visible',
					   'overflow-x' : 'hidden',
					   'width' : 'inherit',
					});
					setTimeout(function(){
						$overlay.removeClass('active');
					}, 200);
				}
			});
		}
	});
}

