function addToCart(){
	$(".container").on('submit', '.products-list form.addtocart', function () {
        var f = $(this);
        $.post(f.attr('action') + '?html=1', f.serialize(), function (response) {
            

            if (response.status == 'ok') {

                var cart_total = $(".cart-total");
                var cart_count = $(".cart-count");
				
				var origin = f.closest('li');
                    var block = $('<div></div>').append(origin.html());
                    block.css({
                        'z-index': 100500,
                        background: '#fff',
                        top: origin.offset().top,
                        left: origin.offset().left,
                        width: origin.width()+'px',
                        height: origin.height()+'px',
                        position: 'absolute',
                        overflow: 'hidden'
                    }).appendTo('body').css({'border':'2px solid #eee','padding':'20px','background':'#fff'}).animate({
                        top: cart_total.offset().top,
                        left: cart_total.offset().left,
                        width: '10px',
                        height: '10px',
                        opacity: 0.7
                    }, 700, function() {
                        $(this).remove();
                        cart_total.html(response.data.total);
                        cart_count.html(response.data.count + ' тов.');
                    });

            } else if (response.status == 'fail') {
                alert(response.errors);
            }

        }, "json");
        return false;
    });
}

function ajaxFilters(){
	var f = function () {
        var ajax_form_callback = function (f) {
            var fields = f.serializeArray();
            var params = [];
            for (var i = 0; i < fields.length; i++) {
                if (fields[i].value !== '') {
                    params.push(fields[i].name + '=' + fields[i].value);
                }
            }
            var url = '?' + params.join('&');
            $(window).lazyLoad && $(window).lazyLoad('sleep');
            $('#product-list').addClass('loader');
            $.get(url+'&_=_', function(html) {
                var tmp = $('<div></div>').html(html);
                $('#product-list').html(tmp.find('#product-list').html()).removeClass('loader');
                if (!!(history.pushState && history.state !== undefined)) {
                    window.history.pushState({}, '', url);
                }
				$(window).lazyLoad && $(window).lazyLoad('reload');
            });
        };

        $('.filters.ajax form input').change(function () {
            ajax_form_callback($(this).closest('form'));
        });
        $('.filters.ajax form').submit(function () {
            ajax_form_callback($(this));
            return false;
        });

        $('.filters .slider').each(function () {
            if (!$(this).find('.filter-slider').length) {
                $(this).append('<div class="filter-slider"></div>');
            } else {
                return;
            }
            var min = $(this).find('.min');
            var max = $(this).find('.max');
            var min_value = parseFloat(min.attr('placeholder'));
            var max_value = parseFloat(max.attr('placeholder'));
            var step = 1;
            var slider = $(this).find('.filter-slider');
            if (slider.data('step')) {
                step = parseFloat(slider.data('step'));
            } else {
                var diff = max_value - min_value;
                if (Math.round(min_value) != min_value || Math.round(max_value) != max_value) {
                    step = diff / 10;
                    var tmp = 0;
                    while (step < 1) {
                        step *= 10;
                        tmp += 1;
                    }
                    step = Math.pow(10, -tmp);
                    tmp = Math.round(100000 * Math.abs(Math.round(min_value) - min_value)) / 100000;
                    if (tmp && tmp < step) {
                        step = tmp;
                    }
                    tmp = Math.round(100000 * Math.abs(Math.round(max_value) - max_value)) / 100000;
                    if (tmp && tmp < step) {
                        step = tmp;
                    }
                }
            }
            slider.slider({
                range: true,
                min: parseFloat(min.attr('placeholder')),
                max: parseFloat(max.attr('placeholder')),
                step: step,
                values: [parseFloat(min.val().length ? min.val() : min.attr('placeholder')),
                    parseFloat(max.val().length ? max.val() : max.attr('placeholder'))],
                slide: function( event, ui ) {
                    var v = ui.values[0] == $(this).slider('option', 'min') ? '' : ui.values[0];
                    min.val(v);
                    v = ui.values[1] == $(this).slider('option', 'max') ? '' : ui.values[1];
                    max.val(v);
                },
                stop: function (event, ui) {
                    min.change();
                }
            });
            min.add(max).change(function () {
                var v_min =  min.val() === '' ? slider.slider('option', 'min') : parseFloat(min.val());
                var v_max = max.val() === '' ? slider.slider('option', 'max') : parseFloat(max.val());
                if (v_max >= v_min) {
                    slider.slider('option', 'values', [v_min, v_max]);
                }
            });
        });
    };
    f();
}

function changeProductsView(){
	$(document).on('click', '.products-views li:not(".active")', function() {
		val = $(this).data('view');
		$.cookie('products_view', val, {
			expires: 30,
			path: '/'
		});
		$(this).siblings().removeClass('active');
		$(this).addClass('active');

		$('#product-list').addClass('loader');
		$.post(window.location.href, function(html) {
			var tmp = $('<div></div>').html(html);
			$('#product-list').html(tmp.find('#product-list').html()).removeClass('loader');

			$(".products-item-gallery").brazzersCarousel();

			if ($(window).lazyLoad) {
				$(window).lazyLoad('reload');
			}
		});
		return false;
	});
}

function changeQty(){
	$('.minus').click(function () {
		var $input = $(this).parent().find('input');
		var count = parseInt($input.val()) - 1;
		count = count < 1 ? 1 : count;
		$input.val(count);
		$input.change();
		return false;
	});
	$('.plus').click(function () {
		var $input = $(this).parent().find('input');
		$input.val(parseInt($input.val()) + 1);
		$input.change();
		return false;
	});
}

function productsFiltersMobile(){
	var a = function () {
        var ajax_form_callback_m = function (f) {
            var fields = f.serializeArray();
            var params = [];
            for (var i = 0; i < fields.length; i++) {
                if (fields[i].value !== '') {
                    params.push(fields[i].name + '=' + fields[i].value);
                }
            }
            var url = '?' + params.join('&');
            $(window).lazyLoad && $(window).lazyLoad('sleep');
            $('#product-list').addClass('loader');
            $.get(url+'&_=_', function(html) {
                var tmp = $('<div></div>').html(html);
                $('#product-list').html(tmp.find('#product-list').html()).removeClass('loader');
                if (!!(history.pushState && history.state !== undefined)) {
                    window.history.pushState({}, '', url);
                }
				$(window).lazyLoad && $(window).lazyLoad('reload');
				if(minWidth(992)){
					$(".products-item-gallery").brazzersCarousel();
				}
            });
        };

        $('.filters-mobile.ajax form input').change(function () {
            ajax_form_callback_m($(this).closest('form'));
        });
        $('.filters-mobile.ajax form').submit(function () {
            ajax_form_callback_m($(this));
            return false;
        });

        $('.filters-mobile .slider').each(function () {
            if (!$(this).find('.filter-slider').length) {
                $(this).append('<div class="filter-slider"></div>');
            } else {
                return;
            }
            var min = $(this).find('.min');
            var max = $(this).find('.max');
            var min_value = parseFloat(min.attr('placeholder'));
            var max_value = parseFloat(max.attr('placeholder'));
            var step = 1;
            var slider = $(this).find('.filter-slider');
            if (slider.data('step')) {
                step = parseFloat(slider.data('step'));
            } else {
                var diff = max_value - min_value;
                if (Math.round(min_value) != min_value || Math.round(max_value) != max_value) {
                    step = diff / 10;
                    var tmp = 0;
                    while (step < 1) {
                        step *= 10;
                        tmp += 1;
                    }
                    step = Math.pow(10, -tmp);
                    tmp = Math.round(100000 * Math.abs(Math.round(min_value) - min_value)) / 100000;
                    if (tmp && tmp < step) {
                        step = tmp;
                    }
                    tmp = Math.round(100000 * Math.abs(Math.round(max_value) - max_value)) / 100000;
                    if (tmp && tmp < step) {
                        step = tmp;
                    }
                }
            }
            slider.slider({
                range: true,
                min: parseFloat(min.attr('placeholder')),
                max: parseFloat(max.attr('placeholder')),
                step: step,
                values: [parseFloat(min.val().length ? min.val() : min.attr('placeholder')),
                    parseFloat(max.val().length ? max.val() : max.attr('placeholder'))],
                slide: function( event, ui ) {
                    var v = ui.values[0] == $(this).slider('option', 'min') ? '' : ui.values[0];
                    min.val(v);
                    v = ui.values[1] == $(this).slider('option', 'max') ? '' : ui.values[1];
                    max.val(v);
                },
                stop: function (event, ui) {
                    min.change();
                }
            });
            min.add(max).change(function () {
                var v_min =  min.val() === '' ? slider.slider('option', 'min') : parseFloat(min.val());
                var v_max = max.val() === '' ? slider.slider('option', 'max') : parseFloat(max.val());
                if (v_max >= v_min) {
                    slider.slider('option', 'values', [v_min, v_max]);
                }
            });
        });
    };
    a();
}

$(function() {
    openMobileMenu();
    menus();
    homeSlider();
    brandsSlider();
    productsSlider();
    changeProductsView();
	addToCart();
    ajaxFilters();
    productsFiltersMobile();
    changeQty();

    $('.toobar-buttons li a').click(function (e) {
        e.preventDefault();
        var $hiddenId;
        var $sectionId = '#js-section';
        var $filterId = '#js-filter';
        var $thisId = $(this).data('id');
        var $this = $(this);

        $('.toobar-buttons li a').removeClass('active');
        if (($($sectionId).is(':hidden') && $($filterId).is(':hidden')) || (!$($filterId).length && $($sectionId).is(':hidden'))) {
            $($thisId).slideDown(300);
            $this.addClass('active');
        } else {
            if ($thisId == $sectionId)
                $hiddenId = $filterId;
            else
                $hiddenId = $sectionId;

            if ($($thisId).is(':hidden')) {
                $($hiddenId).slideUp(300, function () {
                    $($thisId).slideDown(300);
                });
                $this.addClass('active');
            } else
                $($thisId).slideUp(300);
        }
	});
});

